import React from 'react';

export default function Row({nombre , numero, equipo, url}) {
  
    return (
        <tr>
            <td>{nombre}</td>
            <td>{numero}</td>
            <td>{equipo}</td>
            <td><img src={url} alt="Jugador"/></td>
        </tr>
    );
}
